import React from "react";
import CartSingleProduct from "../CartSingleProduct/CartSingleProduct";

import "./Cart.css";

const Cart = ({ cart }) => {
  return (
    <div className="cart-container  my-5 p-5">
      <div className="details-container">
        {cart?.map((product) => (
          <CartSingleProduct
            key={product._id}
            item={product}
          ></CartSingleProduct>
        ))}
      </div>
      {/* <div className="summary-container">
        <SummaryCart
          cart={cart}
          // handleBuy={handleBuy}
        ></SummaryCart>
      </div> */}
    </div>
  );
};

export default Cart;
